import React from 'react';



class Practise extends React.Component{

    constructor(props){
        super(props);
        this.state = {
            login : false
        }
    }


    render(){

        if(this.state.login){
            return(
                <>
                        login is true
                </>
            )
        }else{
            return(
                <>
                        login is false
                </>
            )
        }



    }
}


export default Practise;
